import React, { Component } from "react";
import "../containers/Home.css"
import {connect} from "react-redux";
import userService from "../services/userService";
import {findCurrentUser} from "../actions/userActions";
import LabelListComponent from "../components/label/LabelListComponent";
import NoteListComponent from '../components/note/NoteListComponent';

const UserService = new userService();

class DefaultLayoutComponent extends Component {
    componentDidMount() {
        this.props.findCurrentUser();
        console.log(this.props.user)
    }

    render() {
        return (
            <div className="App">
                <br/>
                <div className={"row"}>
                    <div className="col-1">

                    </div>
                    <div className="col-2">
                        {/*<LabelListComponent/>*/}
                    </div>
                    <div className="col-6">
                        {/*<NoteListComponent/>*/}
                    </div>
                </div>
            </div>
        )
    }
}

const stateToPropertyMapper = (state) => ({
    user: state.user.user
});
const dispatchToPropertyMapper = (dispatch) => ({
    findCurrentUser: () => {
        UserService.findCurrentUser().then(user => {
            dispatch(findCurrentUser(user))
        })
    }
});
export default connect(
    stateToPropertyMapper,
    dispatchToPropertyMapper
)(DefaultLayoutComponent)
